import React, { useState, useEffect } from 'react';
import { icons } from 'react-icons/fa';
import * as api from '../library/api';
import * as ultility from '../library/ultility';

function Navbar({ isOpen }) {
    const [open, setOpen] = useState(true)
    const ToggleMobileNavbar = () => {
        setOpen(!open);
        isOpen(open);
    }
    useEffect(() => {
        ToggleMobileNavbar();
    }, [])
    const Logout = () => {
        api.Post("/Logout/", null, function (response) {
            if (response) {
                ultility.DeleteCookie("user");
                window.location.href = '/Login'
            }
        });
    }
    return (
        <>
            <nav className="navbar navbar-expand-lg">
                <div className="container-fluid d-flex align-items-center justify-content-between">
                    <div className="">
                        <i className={open ? "burger open" : "burger"} onClick={ToggleMobileNavbar}>
                            <span></span>
                            <span></span>
                            <span></span>
                        </i>
                    </div>
                    <div className="navbar-header">
                    </div>
                    <div class="dropdown show">
                        <a class="btn btn-secondary dropdown-toggle" href="#" role="button" id="dropdownMenuLink" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
                            Dropdown link
                        </a>
                        <div class="dropdown-menu" aria-labelledby="dropdownMenuLink">
                            <a class="dropdown-item" href="#"><i></i>Logout</a>
                            <a class="dropdown-item" href="#"><i><icons.fafaUser /> </i>Account</a>
                        </div>
                    </div>
                </div>
            </nav>
        </>
    );
}

export default Navbar;
